    /**
    *
    * @description: 获取某一个桶下文件集合
    * @author: liguangyue
    * @param: bucketName 桶名称
    * @return: Result 公共返回类
    * @date: 2021/3/26 14:59
    **/
    @PostMapping(value = "/getFileList")
    public Result getFileList(@RequestParam("bucketName") String bucketName){
        try {
            //获取存储捅名
            bucketName = StringUtils.isNotBlank(bucketName) ? bucketName : minioConfig.getBucketName();
            //列出存储桶中所有对象
            Iterable<io.minio.Result<Item>> results = minioService.listObjects(bucketName);
            //迭代器
            Iterator<io.minio.Result<Item>> iterator = results.iterator();
            List<Object> items = new ArrayList<>();
            String format = "{'fileName':'%s','fileSize':'%s'}";

            while (iterator.hasNext()) {
                //返回迭代中的下一个元素。
                Item item = iterator.next().get();
                //封装信息
                items.add(JSON.parse(String.format(format, "http://localhost:9000/"+bucketName+"/"+item.objectName(), formatFileSize(item.size()))));
            }
            return Result.success(items);
        } catch (Exception e) {
            log.error("获取文件列表失败,错误信息: " + e.getMessage());
            return Result.error("获取文件列表失败");
        }
    }

    /**
    *
    * @description: 获取单个文件访问地址
    * @author: liguangyue
    * @param: bucketName 桶名称
     * @param: expires 失效时间
     * @param: objectName 文件名称
    * @return: Result 公共返回类
    * @date: 2021/3/26 15:01
    **/
    @PostMapping("/getPreview")
    public Result getPreviewFile(@RequestParam("bucketName") String bucketName, @RequestParam("expires") Integer expires, @RequestParam("objectName") String objectName) {
        //获取存储捅名
        bucketName = StringUtils.isNotBlank(bucketName) ? bucketName : minioConfig.getBucketName();
        //生成一个给HTTP GET请求用的presigned URL
        String filePath = minioService.presignedGetObject(bucketName, objectName, expires);
        //封装信息
        return Result.success(filePath);
    }

    /**
    *
    * @description: 获取某一个桶下所有文件的访问地址
    * @author: liguangyue
    * @param: bucketName 桶名称
     * @param: expires 失效时间
    * @return: Result 公共返回类
    * @date: 2021/3/26 15:04
    **/
    @PostMapping("/previewList")
    public Result getPreviewList(@RequestParam("bucketName") String bucketName, @RequestParam("expires") Integer expires) {

        try {
            //获取存储捅名
            bucketName = StringUtils.isNotBlank(bucketName) ? bucketName : minioConfig.getBucketName();
            //列出存储桶中所有对象
            Iterable<io.minio.Result<Item>> myObjects = minioService.listObjects(bucketName);
            //迭代器
            Iterator<io.minio.Result<Item>> iterator = myObjects.iterator();
            List<Object> items = new ArrayList<>();
            String format = "{'fileName':'%s','fileSize':'%s'}";
            while (iterator.hasNext()) {
                //返回迭代中的下一个元素。
                Item item = iterator.next().get();
                //生成一个给HTTP GET请求用的presigned URL
                String filePath = minioService.presignedGetObject(bucketName, item.objectName(), expires);
                //封装信息
                items.add(JSON.parse(String.format(format, filePath, formatFileSize(item.size()))));
            }
            return Result.success(items);
        } catch (Exception e) {
            return Result.error("生成可以预览的文件链接失败,错误信息:" + e.getMessage());
        }

    }

    /**
     * @description: 显示文件大小信息单位
     * @author: liguangyue
     * @param file 文件大小
     * @return: Result 公共返回类
     * @date: 2021/3/26 15:12
     */
    private static String formatFileSize(long file) {
        DecimalFormat df = new DecimalFormat("#.00");
        String fileSizeString = "";
        String wrongSize = "0B";
        if (file == 0) {
            return wrongSize;
        }
        if (file < 1024) {
            fileSizeString = df.format((double) file) + " B";
        } else if (file < 1048576) {
            fileSizeString = df.format((double) file / 1024) + " KB";
        } else if (file < 1073741824) {
            fileSizeString = df.format((double) file / 1048576) + " MB";
        } else {
            fileSizeString = df.format((double) file / 1073741824) + " GB";
        }
        return fileSizeString;
    }

    @SneakyThrows
    public  void uploadFile(MultipartFile file, String bucketName) {
        // 获取存储桶名称,不存在则使用默认桶名
        bucketName = StringUtils.isNotBlank(bucketName) ? bucketName : minioConfig.getBucketName();

        // 判断是否存在该存储桶
        if (!minioService.bucketExists(bucketName)) {
            // 不存在则创建
            minioService.makeBucket(bucketName);
            // 设置存储桶只读策略
            String bucketPolicy ="{\"Version\":\"2012-10-17\",\"Statement\":[{\"Effect\":\"Allow\",\"Principal\":{\"AWS\":[\"*\"]},\"" +
                    "Action\":[\"s3:GetBucketLocation\",\"s3:ListBucket\"],\"Resource\":[\"arn:aws:s3:::fast\"]},{\"Effect\":\"Allow\",\"" +
                    "Principal\":{\"AWS\":[\"*\"]},\"Action\":[\"s3:GetObject\"],\"Resource\":[\"arn:aws:s3:::" +
                    bucketName+"/*\"]}]}";
            // 设置存储桶策略
            minioService.setBucketPolicy(bucketName,bucketPolicy);
        }
        // 原始文件名
        String fileName = file.getOriginalFilename();
        // 获取文件后缀名
        String extName = FileNameUtil.extName(fileName);
        // 定义文件路径
        String format = new SimpleDateFormat("yyyyMMdd").format(new Date());
        // 定义文件修改之后的名字,去除uuid中的' - '
        String fileuuid = UUID.randomUUID().toString().replaceAll("-", "");
        // 定义新的文件名
        String objectName = format + fileuuid + "." + extName;
        //上传文件
        minioService.putObject(bucketName, file, objectName);
    }


    @SneakyThrows
    public  void uploadFile(String bucketName,String filePath, String fileName) {
        // 获取存储桶名称,不存在则使用默认桶名
        bucketName = StringUtils.isNotBlank(bucketName) ? bucketName : minioConfig.getBucketName();

        // 判断是否存在该存储桶
        if (!minioService.bucketExists(bucketName)) {
            // 不存在则创建
            minioService.makeBucket(bucketName);
            // 设置存储桶只读策略
            String bucketPolicy ="{\"Version\":\"2012-10-17\",\"Statement\":[{\"Effect\":\"Allow\",\"Principal\":{\"AWS\":[\"*\"]},\"" +
                    "Action\":[\"s3:GetBucketLocation\",\"s3:ListBucket\"],\"Resource\":[\"arn:aws:s3:::fast\"]},{\"Effect\":\"Allow\",\"" +
                    "Principal\":{\"AWS\":[\"*\"]},\"Action\":[\"s3:GetObject\"],\"Resource\":[\"arn:aws:s3:::" +
                    bucketName+"/*\"]}]}";
            // 设置存储桶策略
            minioService.setBucketPolicy(bucketName,bucketPolicy);
        }
        // 获取文件后缀名
        String extName = FileNameUtil.extName(fileName);
        // 定义文件路径
        String format = new SimpleDateFormat("yyyyMMdd").format(new Date());
        // 定义文件修改之后的名字,去除uuid中的' - '
        String fileuuid = UUID.randomUUID().toString().replaceAll("-", "");
        // 定义新的文件名
        String objectName = format + fileuuid + "." + extName;
        InputStream is = FileUtils.openInputStream(new File(filePath+fileName));
        //上传文件
        //获取对象信息和对象的元数据。
        ObjectStat objectStat = minioService.statObject(bucketName, fileName);
        //setContentType 设置发送到客户机的响应的内容类型
        minioService.putObject(bucketName, objectName,is, objectStat.contentType());
    }


